import{_ as o,o as l,c as t,ag as e}from"./chunks/framework.DEqXEGcv.js";const r="/screenshots/OCCP2015.png",i="/screenshots/OCCP2020.png",n="/screenshots/OCCP2010.png",q=JSON.parse('{"title":"전출처리","description":"","frontmatter":{},"headers":[],"relativePath":"occp/move-out.md","filePath":"occp/move-out.md","lastUpdated":null}'),s={name:"occp/move-out.md"};function h(c,a,u,d,p,g){return l(),t("div",null,[...a[0]||(a[0]=[e('<h1 id="전출처리" tabindex="-1">전출처리 <a class="header-anchor" href="#전출처리" aria-label="Permalink to &quot;전출처리&quot;">​</a></h1><blockquote><p><strong>메뉴 경로</strong>: 입주자 &gt; 전출처리</p></blockquote><h2 id="개요" tabindex="-1">개요 <a class="header-anchor" href="#개요" aria-label="Permalink to &quot;개요&quot;">​</a></h2><p>기존 입주자의 전출(퇴거) 처리를 수행합니다. 전출 전 장기수선충당금 정산, 중간정산서 조회, 전입/전출자 현황 조회 등의 업무를 함께 처리합니다.</p><hr><h2 id="장기수선충당금" tabindex="-1">장기수선충당금 <a class="header-anchor" href="#장기수선충당금" aria-label="Permalink to &quot;장기수선충당금&quot;">​</a></h2><p><img src="'+r+'" alt="장기수선충당금 화면"></p><h3 id="기능-설명" tabindex="-1">기능 설명 <a class="header-anchor" href="#기능-설명" aria-label="Permalink to &quot;기능 설명&quot;">​</a></h3><p>전출 시 세입자의 입주기간 동안 발생한 충당금을 계산하여 확인할 수 있습니다.</p><h3 id="사용-방법" tabindex="-1">사용 방법 <a class="header-anchor" href="#사용-방법" aria-label="Permalink to &quot;사용 방법&quot;">​</a></h3><ol><li><strong>조회 기간 설정</strong>: 계산 시기를 표시하여 처리 버튼을 클릭합니다.</li><li><strong>충당금 계산</strong>: 행두 이력을 날 후 동, 전체되는 단기수선충당금 (해당 전출기간/사직일공제일), 작성방법을 참조하여 계산합니다.</li><li><strong>금액 확인</strong>: <ul><li><strong>납입금기</strong>: 세대별 입력된 금액 비이브이며, 수령인에게 납부금 입력합니다.</li><li><strong>반환금기</strong>: 기 세대별 입력된 단위금액 비이브이며, 전출일자에 따라 반환 금액이 계산됩니다.</li></ul></li><li><strong>인쇄</strong>: 계산이 완료된 후 전출일자, 전출일자, 전입일자를 입력하여 확인하면 작성내용이 나타납니다.</li></ol><blockquote><p><strong>참고</strong>: 전입일자는 2022.01.13 이후 1월 2차, 전출일자는 2022.01.13 이후 3월 12일 분이 단위로 계산됩니다.</p><p>양식선택에서 양식을 선택 후 인쇄할 수 있습니다 (예: <strong>충당금 납부확인서 발급증</strong>).</p></blockquote><hr><h2 id="전출처리-1" tabindex="-1">전출처리 <a class="header-anchor" href="#전출처리-1" aria-label="Permalink to &quot;전출처리&quot;">​</a></h2><p><img src="'+i+'" alt="전출처리 화면"></p><h3 id="기능-설명-1" tabindex="-1">기능 설명 <a class="header-anchor" href="#기능-설명-1" aria-label="Permalink to &quot;기능 설명&quot;">​</a></h3><p>전출세대의 동/호수 및 전출일자를 입력 후 도출 시 해당 세대에 대한 미납 및 자청관리가 표시됩니다. 예시자입 표를 통해 처리하여 체크/미납도 조회 가능합니다.</p><h3 id="_1-전출처리-절차" tabindex="-1">1. 전출처리 절차 <a class="header-anchor" href="#_1-전출처리-절차" aria-label="Permalink to &quot;1. 전출처리 절차&quot;">​</a></h3><ol><li>전출세대 동/호수와 전출일자를 입력 후 도출 시 해당 세대에 대한 자청관리가 표시됩니다.</li><li>지청 버튼을 눌러서 장기 수납관계를 별도로 확인합니다. <ul><li><strong>단</strong>, 미납 보일 경우 타자이의 미납기간에 따른 조건에 따라 다음 달 기 동안 입주자가 동일하지 않으면 진행할 수 없습니다.</li></ul></li></ol><h3 id="_2-전출처리-방법" tabindex="-1">2. 전출처리 방법 <a class="header-anchor" href="#_2-전출처리-방법" aria-label="Permalink to &quot;2. 전출처리 방법&quot;">​</a></h3><ul><li>전출처리의 동/호와 전출일자를 입력 후 도출 차트를 선택한 다음 전출처리 목록을 선택하여 처리합니다.</li><li>전출처리 화면의 중간정산 버튼을 클릭하여 중간정산 목록을 확인합니다.</li><li>진행기록 버튼을 눌러서 세대 중 중간관계를 선택한 선택 화면을 볼 수 있습니다 (중간관계의 내역기록/중간관계의 리스트 등록).</li><li><strong>*미납금액은 반드시 수납한 후 처리하기를 권장합니다.</strong></li></ul><h3 id="중간정산서-조회" tabindex="-1">중간정산서 조회 <a class="header-anchor" href="#중간정산서-조회" aria-label="Permalink to &quot;중간정산서 조회&quot;">​</a></h3><ul><li>청산인 내역을 조회할 수 있습니다.</li><li>선택한 세대 단위에 상세버튼을 클릭하면 중간정산서 내역을 세부적으로 볼 수 있습니다.</li><li>동호를 다름 클릭 시 청산세대를 재 확인 할 수 있습니다.</li></ul><blockquote><p><strong>*인쇄기능은 잡아주 대기 중인 정산확인 후에 체크하여 인쇄(단축키)가 이 되면 정산처리가 진행됩니다. 인쇄/재전화 경우에 전출처리가 이 되면 자동 후 완료처리가 됩니다.</strong></p></blockquote><hr><h2 id="전입-전출자현황" tabindex="-1">전입/전출자현황 <a class="header-anchor" href="#전입-전출자현황" aria-label="Permalink to &quot;전입/전출자현황&quot;">​</a></h2><p><img src="'+n+'" alt="전입/전출자현황 화면"></p><h3 id="기능-설명-2" tabindex="-1">기능 설명 <a class="header-anchor" href="#기능-설명-2" aria-label="Permalink to &quot;기능 설명&quot;">​</a></h3><p>전출 및 전입자의 의 정보를 조회할 수 있습니다.</p><h3 id="사용-방법-1" tabindex="-1">사용 방법 <a class="header-anchor" href="#사용-방법-1" aria-label="Permalink to &quot;사용 방법&quot;">​</a></h3><ol><li><strong>조회</strong>: 조회구분에서 전입/전출을 선택 후 금액기간을 입력하여 조회합니다.</li><li><strong>세부 조회</strong>: 조회화면을 좌/우로 금호를 선택하면 미입 현재자의 추가 정보를 볼 수 있습니다.</li></ol><blockquote><p><strong>전출 조회</strong>: 전출처리화면에서 전출 처리된 세대만 조회가 가능합니다.</p></blockquote><hr><h2 id="관련-메뉴" tabindex="-1">관련 메뉴 <a class="header-anchor" href="#관련-메뉴" aria-label="Permalink to &quot;관련 메뉴&quot;">​</a></h2><ul><li><a href="/occp/move-in.html">입주처리</a> - 신규 입주 처리</li><li><a href="/recp/overdue.html">미납조회</a> - 미납 관리비 확인</li></ul><h2 id="주의사항" tabindex="-1">주의사항 <a class="header-anchor" href="#주의사항" aria-label="Permalink to &quot;주의사항&quot;">​</a></h2><ul><li>전출 전 미납 관리비를 반드시 정산해야 합니다.</li><li>장기수선충당금 정산을 누락하지 마세요.</li><li>전출 처리 후 취소가 어려우므로 신중히 처리하세요.</li><li>미납금액은 반드시 수납 처리 후 전출 처리를 진행하세요.</li></ul>',37)])])}const m=o(s,[["render",h]]);export{q as __pageData,m as default};
